import React, { useContext } from "react";
import { Context } from "../../context/context";
import { Link } from "react-router-dom";
import { Swiper, SwiperSlide } from "swiper/react";
import "./Category.css";
const Category = () => {
  const { listProducts } = useContext(Context);

  const sweetCake = listProducts.filter((card) => card.categorysId === 1);
  const limitedSweetCake = sweetCake.slice(0, 6);

  const saltedCake = listProducts
    .filter((card) => card.categorysId === 2)
    .slice(0, 6);
  const cupCake = listProducts
    .filter((card) => card.categorysId === 3)
    .slice(0, 6);
  const cheeseCake = listProducts
    .filter((card) => card.categorysId === 4)
    .slice(0, 6);

  return (
    <div>
      <div>
        <div className="flex flex-col items-center justify-center gap-4 ">
          <div className="flex ">
            <span className="text-[#8c8b8b] text-[1.5rem]">Bánh Ngọt</span>
          </div>
          <div className=" flex justify-center items-center">
            <Swiper slidesPerView={6} spaceBetween={10}>
              {limitedSweetCake.map((card) => (
                <SwiperSlide key={card.id}>
                  <div className="">
                    <Link
                      to={`/card/${card.id}`}
                      className="flex flex-col gap-1 r-card"
                    >
                      <img src={card.image} className="img-card" />
                      <div>{card.name}</div>
                      <div>{card.price}</div>
                    </Link>
                  </div>
                </SwiperSlide>
              ))}
            </Swiper>
          </div>

          <div className="flex ">
            <span className="text-[#8c8b8b] text-[1.5rem]">Bánh Mặn</span>
          </div>
          <div className="flex flex-row">
            {saltedCake?.map((card) => {
              return (
                <div>
                  <Link
                    to={`/card/${card.id}`}
                    className="flex flex-col gap-1  r-card"
                  >
                    <img src={card.image} className="img-card" />
                    <div>{card.name}</div>
                    <div>{card.price}</div>
                  </Link>
                </div>
              );
            })}
          </div>
          <div className="flex ">
            <span className="text-[#8c8b8b] text-[1.5rem]">Bánh Nướng</span>
          </div>
          <div className="flex flex-row">
            {cupCake?.map((card) => {
              return (
                <div>
                  <Link
                    to={`/card/${card.id}`}
                    className="flex flex-col gap-1  r-card"
                  >
                    <img src={card.image} className="img-card" />
                    <div>{card.name}</div>
                    <div>{card.price}</div>
                  </Link>
                </div>
              );
            })}
          </div>
          <div className="flex">
            <span className="text-[#8c8b8b] text-[1.5rem]">Bánh Kem</span>
          </div>
          <div className="flex flex-row">
            {cheeseCake?.map((card) => {
              return (
                <div>
                  <Link
                    to={`/card/${card.id}`}
                    className="flex flex-col gap-1  r-card"
                  >
                    <img src={card.image} className="img-card" />
                    <div>{card.name}</div>
                    <div>{card.price}</div>
                  </Link>
                </div>
              );
            })}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Category;
